import students from "./Students.json";

const Practice3 = () => {
  return (
    <div>
      <ul>
        {students
          .filter((student) => student.yas < 25)
          .map((student, index) => (
            <li key={index}>{student.isim}</li>
          ))}
      </ul>
      
